import './Holdings.css'
import Find from '../assets/research.png'
import Money from '../assets/money.png'
import Market from '../assets/equity.png'
import {Link} from 'react-router-dom'
import TeamCard from './TeamCard'


const Holdings = (props) => {

    const user = props.user
    const teams = props.teams

    const getMyTeams = () =>{
        const myTeams1 = []
        if(user.shares !== 0){
            user.shares.map(s => {
                let shareTeam = s.substring(0,s.length - 4)
                if(!myTeams1.includes(shareTeam)){
                    myTeams1.push(shareTeam)
                }
            })
            return myTeams1
        } 
    }

    return(
        <>
        <div className='Holdings'>   
            {teams.map(t => {
                let indTeams = getMyTeams()
                if(user.shares.includes(t.team)){
                    return <TeamCard {...user} />
                }
            })}
        </div>
        </>
    )
}

export default Holdings
